import React from "react";

const RightContainer = (users) => {

    return(
        <div className="right_container">
            {users.map((output, id) => (
                <span key={id}>
                    {(output.name === localStorage.getItem('login')) ? ( <span></span> ): ( <span>{output.name}</span> ) }
                </span>
            ) )}
            <h3 className="login">{users.length}</h3>
        </div>
    )

}

export default RightContainer;
